import "./styles/Contact.css"

const Contact = () => {
   
        return (
                <div className="contactMe">
                        <form>
                                <div className="inputs">
                                        <input type="text" placeholder="Company name"></input>
                                        <input type="text" placeholder="Work position name"></input>
                                </div>
                                <textarea placeholder="Write mi..."></textarea>
                                <button>Send</button>
                        </form>
                </div>
        );
       }
    


export default Contact;
